        public static Color GetDiscordColor(PersonalColor personalColor)
        {
            switch (personalColor)
            {
                case Red:
                    return Color.Red;
                case Blue:
                    return Color.Blue;
                case Yellow:
                    return Color.Gold;
                case Green:
                    return Color.Green;
                case Black:
                    return new Color(0x000000);
                case Brown:
                    return new Color(0x80461B);
                case Purple:
                    return Color.Purple;
                case Gray:
                    return Color.LightGrey;
                case White:
                    return new Color(0xFFFFFF);
                case Pink:
                    return Color.Magenta;
                default:
                    return Color.Default;
            }
        }
